// proof.js
// debug logs included to make sure things fire in the console

document.addEventListener('DOMContentLoaded', () => {
  console.log('üìÑ proof.js loaded');

  // --- grab your elements
  const canvas      = document.getElementById('proofCanvas');
  const ctx         = canvas.getContext('2d');
  const genBtn      = document.getElementById('generateBtn');
  const downloadBtn = document.getElementById('downloadLink');

  // --- set up your background Image()
  const background = new Image();
  let bgReady = false;

  background.onload = () => {
    console.log('‚úÖ template loaded');
    bgReady = true;
    // draw it once onto the empty canvas
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    ctx.drawImage(background, 0, 0, canvas.width, canvas.height);
  };

  background.onerror = e => {
    console.error('‚ùå template failed to load:', background.src);
  };

  // YOUR TEMPLATE: one single string, no line-breaks!
  const templateB64 = '';

  // kick off the load
  const dataUri = 'data:image/png;base64,' + templateB64;
  console.log('Attempting to load template from data URI‚Ä¶');
  background.src = dataUri;


  // sanitize helpers for filenames
  let cleanClient  = 'client';
  let cleanProject = 'project';


  // 2) Generate Proof button
  genBtn.addEventListener('click', async () => {
    console.log('‚ñ∂Ô∏è Generate clicked');
    downloadBtn.style.display = 'none';

    if (!bgReady) {
      return alert('Please wait‚Äîtemplate still loading.');
    }

    // wait for font
    await document.fonts.load("20px 'Myriad Pro'");
    console.log('üî§ Font loaded');

    // redraw template
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    ctx.drawImage(background, 0, 0, canvas.width, canvas.height);

    // read inputs
    const clientName  = document.getElementById('clientName').value.trim();
    const projectName = document.getElementById('projectName').value.trim();
    const dateValue   = document.getElementById('date').value.trim();
    const revision    = document.getElementById('revision').value.trim();
    const artworkFile = document.getElementById('artwork').files[0];

    // sanitize for filename
    cleanClient  = clientName  ? clientName.replaceAll(' ', '_')  : 'client';
    cleanProject = projectName ? projectName.replaceAll(' ', '_') : 'project';

    // draw text
    ctx.font         = "20px 'Myriad Pro'";
    ctx.fillStyle    = '#000';
    ctx.textAlign    = 'left';
    ctx.textBaseline = 'top';
    ctx.fillText(clientName, 146.87, 1338);
    ctx.fillText(projectName, 207.93, 1362);
    ctx.fillText(dateValue,    709.58, 1338);
    ctx.fillText(revision,      754.51, 1362);
    console.log('‚úçÔ∏è Text drawn');

    // helper to show download button
    const showDownload = () => {
      downloadBtn.style.display = 'inline-block';
      console.log('‚¨áÔ∏è Download button shown');
    };

    // if user provided artwork, draw that too
    if (artworkFile) {
      const reader = new FileReader();
      reader.onload = e => {
        const img = new Image();
        img.onload = () => {
          // fit into a box
          const maxW = 1071.44, maxH = 1071.44;
          const cx = 613.46, cy = 758;
          const scale = Math.min(maxW / img.width, maxH / img.height);
          const w = img.width * scale, h = img.height * scale;
          ctx.drawImage(img, cx - w/2, cy - h/2, w, h);
          console.log('üñºÔ∏è Artwork drawn');
          showDownload();
        };
        img.src = e.target.result;
      };
      reader.readAsDataURL(artworkFile);
    } else {
      showDownload();
    }
  });


  // 3) Download button
  downloadBtn.addEventListener('click', () => {
    console.log('üì• Download clicked');

    const { jsPDF } = window.jspdf || {};
    if (!jsPDF) {
      return alert('jsPDF failed to load.');
    }

    const pdf     = new jsPDF('portrait', 'pt', [canvas.width, canvas.height]);
    const imgData = canvas.toDataURL('image/png');
    pdf.addImage(imgData, 'PNG', 0, 0, canvas.width, canvas.height);

    const blob = pdf.output('blob');
    const url  = URL.createObjectURL(blob);
    const a    = document.createElement('a');
    a.href     = url;
    a.download = `${cleanClient}_${cleanProject}_proof.pdf`;
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    URL.revokeObjectURL(url);

    console.log('‚úÖ Download triggered');
  });

  // 4) Prevent Enter from submitting the form
  document.querySelectorAll('input').forEach(i => {
    i.addEventListener('keydown', e => {
      if (e.key === 'Enter') e.preventDefault();
    });
  });
});  
